import React from "react";
import './popup.css'


const Popup = (props) => {
const {id,name, img} = props;

    return(
            <li key={`key${id}`} className="popup-li collection-item avatar">
                {console.log(id)}
                <img src={img} alt="" className="circle"></img>
                <p className="black-text"><strong className="label">Title: </strong>{name}</p>
                <p className="black-text"><strong className="label">count: </strong>{id}</p>
            </li>
    )
}

export default Popup;
